import {
  Nav,
  NavLink,
  Ul,
  Li,
  NavIconButton,
  Input,
  DivWithHover,
  ShortcutInputButton,
} from './Navbar.styles';
import { baseTheme } from '../../../styles/theme/theme';
import { useRef, useState } from 'react';
import { useElementSize } from '../../../hooks/useElementSize';
import { NavbarProps } from './Navbar.types';

import { Label } from '../../shared/Label/Label.component';

import { HomeOutlineIcon as HomeIcon } from '../../icons/HomeOutlineIcon';
import { ArrowGrowthIcon as CompletedTodosIcon } from '../../icons/ArrowGrowthIcon';
import { PlusSolidIcon as AddTodoIcon } from '../../icons/PlusSolidIcon';
import { BarsSolidIcon as SidebarIcon } from '../../icons/BarsSolidIcon';
import { MaginifyingGlassSolidIcon as SearchIcon } from '../../icons/MagnifyingGlassSolidIcon';
import { BellRegularIcon as NotificationsIcon } from '../../icons/BellRegularIcon';
import { CircleUserSolidIcon as UserIcon } from '../../icons/CircleUserSolidIcon';
import { useHover } from '../../../hooks/useHover';
import { useFocus } from '../../../hooks/useFocus';

export function Navbar(props: NavbarProps) {
  const { toggleSidebar, isSidebarOpen } = props;

  const { white } = baseTheme.colors;

  const divWithHoverRef = useRef<HTMLDivElement | null>(null);

  const [isDivWithHoverFocus, setOnFocus, setOnBlur] =
    useFocus(divWithHoverRef);

  const isInputHover = useHover(divWithHoverRef);

  // take dimension by button
  const [sidebarIconRef, sidebarIconSize] = useElementSize();
  const [homeIconRef, homeIconSize] = useElementSize();
  const [addTodoIconRef, addTodoIconSize] = useElementSize();
  const [completedTodosIconRef, completedTodosIconSize] = useElementSize();
  const [notificationsIconRef, notificationsIconSize] = useElementSize();
  const [userIconRef, userIconSize] = useElementSize();

  const [label, setLabel] = useState<string | null>(null);

  // foo to set label state to respective button name or set to null
  const setLabelTo = (state: string) => setLabel(state);
  const setLabelNull = () => setLabel(null);

  // boolean to change visibility of label when that is open
  let isLabelSidebarIconVisible = label === 'sidebar';
  let isLabelHomeIconVisible = label === 'home';
  let isLabelAddTodoIconVisible = label === 'add-todo';
  let isLabelCompletedTodosIconVisible = label === 'completedTodos';
  let isLabelNotificationsIconVisible = label === 'notifications';
  let isLabelUserIconVisible = label === 'user';

  // content of whice label
  const sidebarIconLabelContent = isSidebarOpen ? 'Close menu' : 'Open menu';
  const homeIconLabelContent = 'Go to home';
  const addTodoIconLabelContent = 'Add todo';
  const completedTodosIconLabelContent = 'Show produtictivity';
  const notificationsIconLabelContent = 'Open notifications';
  const userIconLabelContent = 'Open profile menu';

  const LabelComponent = (
    isVisible: boolean,
    content: string,
    parentWidth: number
  ) => (
    <Label isVisible={isVisible} content={content} parentWidth={parentWidth} />
  );

  console.log(sidebarIconSize.width);

  return (
    <Nav>
      <Ul>
        <Li
          ref={sidebarIconRef}
          onMouseEnter={() => setLabelTo('sidebar')}
          onMouseLeave={setLabelNull}
        >
          <NavIconButton onClick={toggleSidebar}>
            <SidebarIcon fill={white} />
          </NavIconButton>
          {LabelComponent(
            isLabelSidebarIconVisible,
            sidebarIconLabelContent,
            sidebarIconSize.width
          )}
        </Li>

        <Li
          ref={homeIconRef}
          onMouseEnter={() => setLabelTo('home')}
          onMouseLeave={setLabelNull}
        >
          <NavLink to='/home'>
            <NavIconButton>
              <HomeIcon height={'24px'} width={'24px'} stroke={white} />
            </NavIconButton>
            {LabelComponent(
              isLabelHomeIconVisible,
              homeIconLabelContent,
              homeIconSize.width
            )}
          </NavLink>
        </Li>

        <DivWithHover
          ref={divWithHoverRef}
          isInputHover={isInputHover}
          isDivWithHoverFocus={isDivWithHoverFocus}
          onFocus={setOnFocus}
          onBlur={setOnBlur}
        >
          <Li>
            <SearchIcon id='search-icon' />
            <Input
              isDivWithHoverFocus={isDivWithHoverFocus}
              isInputHover={isInputHover}
              type='text'
              placeholder='Search'
            />
            {(isDivWithHoverFocus && (
              <ShortcutInputButton>/</ShortcutInputButton>
            )) ||
              (isInputHover && <ShortcutInputButton>/</ShortcutInputButton>)}
          </Li>
        </DivWithHover>
      </Ul>

      <Ul>
        <Li
          ref={addTodoIconRef}
          onMouseEnter={() => setLabelTo('add-todo')}
          onMouseLeave={setLabelNull}
        >
          <NavIconButton>
            <AddTodoIcon fill={white} />
          </NavIconButton>
          {LabelComponent(
            isLabelAddTodoIconVisible,
            addTodoIconLabelContent,
            addTodoIconSize.width
          )}
        </Li>

        <Li
          ref={completedTodosIconRef}
          onMouseEnter={() => setLabelTo('completed-todos')}
          onMouseLeave={setLabelNull}
        >
          <NavIconButton>
            <CompletedTodosIcon fill={white} />
          </NavIconButton>
          {LabelComponent(
            isLabelCompletedTodosIconVisible,
            completedTodosIconLabelContent,
            completedTodosIconSize.width
          )}
        </Li>

        <Li
          ref={notificationsIconRef}
          onMouseEnter={() => setLabelTo('notifications')}
          onMouseLeave={setLabelNull}
        >
          <NavIconButton>
            <NotificationsIcon fill={white} />
          </NavIconButton>
          {LabelComponent(
            isLabelNotificationsIconVisible,
            notificationsIconLabelContent,
            notificationsIconSize.width
          )}
        </Li>

        <Li
          ref={userIconRef}
          onMouseEnter={() => setLabelTo('user')}
          onMouseLeave={setLabelNull}
        >
          <NavIconButton>
            <UserIcon fill={white} />
          </NavIconButton>
          {LabelComponent(
            isLabelUserIconVisible,
            userIconLabelContent,
            userIconSize.width
          )}
        </Li>
      </Ul>
    </Nav>
  );
}
